import React, { useState } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from "./pages/Home";
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import Task1 from "./components/Task1"; // Import the modified Task1 component

function App() {

  const MyNavbar = () => {
    return (
      <Navbar bg="light" expand="lg">
        <Navbar.Brand as={Link} to="/">BrandName</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/task1">Task1</Nav.Link> {/* Link to Task1 */}
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
              <NavDropdown.Divider />
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  };

  return (
    <Router>
      <div>
        <MyNavbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/task1" element={<Task1 />} /> {/* Route for Task1 component */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
